package _01_getters_and_setters;

public class people {

	// TODO Auto-generated method stub
	String name;
	String superpower;

	people(String name, String superpower) {
		this.name = name;
	}

	String getName() {
		return name;
	}

	String getSuperpower() {
		return superpower;
	}

	void setName() {
		this.name = name;

	}

	void setSuperpower() {
		this.superpower = superpower;
	}
}
